import time
import unittest

from mainscript import minimum, maximum, summa, product, get_data


class TestMinMaxSumProd(unittest.TestCase):
    """Второй пункт"""
    pos_diff = get_data('positive_diff_numbers.txt')
    pos_unique = get_data('positive_unique_numbers.txt')
    neg_pos = get_data('negative_and_positive.txt')
    only_negative = get_data('only_negative.txt')

    def test_minimum(self):
        self.assertEqual(minimum(self.pos_diff), 1)
        self.assertEqual(minimum(self.pos_unique), 1)
        self.assertEqual(minimum(self.neg_pos), -6)
        self.assertEqual(minimum(self.only_negative), -4)

    def test_maximum(self):
        self.assertEqual(maximum(self.pos_diff), 7)
        self.assertEqual(maximum(self.pos_unique), 1)
        self.assertEqual(maximum(self.neg_pos), 5)
        self.assertEqual(maximum(self.only_negative), -1)

    def test_summa(self):
        self.assertEqual(summa(self.pos_diff), 16)
        self.assertEqual(summa(self.pos_unique), 4)
        self.assertEqual(summa(self.neg_pos), -2)
        self.assertEqual(summa(self.only_negative), -9)

    def test_product(self):
        self.assertEqual(product(self.pos_diff), 105)
        self.assertEqual(product(self.pos_unique), 1)
        self.assertEqual(product(self.neg_pos), 0)
        self.assertEqual(product(self.only_negative), 12)


