class TestCorrectInput(unittest.TestCase):
    def test_input(self):
        self.assertEqual(get_data('string_with_nums.txt'), [1, 2, 3, 4, 5])
        with self.assertRaises(ValueError):
            get_data("string_includes_not_numbers.txt")


